import React from 'react';
import Person from './persons'

function NameList(){
	const persons = [
		'Diana',
		'Bruce']
		const List = persons.map((person,index) =><Person key = {person} props = {person} />)
		return (
			<div>
                 {List}
            </div>
			)
}	
export default NameList
